import React, {useState} from 'react'
import { PlusCircleOutlined } from '@ant-design/icons';
import { Modal, Button, Form, Input } from 'antd';

const PostBike = () => {
    const [showForm, setShowForm] = useState(false)

    const toggleForm = () => {
        setShowForm(!showForm)
    }   

    const submitForm = () => {
        console.log('submitted form')
        setShowForm(false)
    }

    const handleCancel = () => {
        console.log('Canceled form')
        setShowForm(false)
    }

    return (
        <>
           <PlusCircleOutlined onClick={toggleForm} style={{fontSize: 100}}/>
           <Modal 
                title="Add motorcycle" 
                visible={showForm} 
                onOk={submitForm} 
                onCancel={handleCancel}
            >
                <Form
                    name="basic"
                    labelCol={{
                        span: 8,
                    }}
                    wrapperCol={{
                        span: 16,
                    }}
                    initialValues={{
                        remember: true,
                    }}
                    onFinish={onFinish}
                    onFinishFailed={onFinishFailed}
                    autoComplete="off"
                    >
                    <Form.Item
                        label="Username"
                        name="username"
                        rules={[
                        {
                            required: true,
                            message: 'Please input your username!',
                        },
                        ]}
                    >
                        <Input />
                    </Form.Item>

                    <Form.Item
                        label="Password"
                        name="password"
                        rules={[
                        {
                            required: true,
                            message: 'Please input your password!',
                        },
                        ]}
                    >
                        <Input.Password />
                    </Form.Item>
                    <Form.Item
                        name="remember"
                        valuePropName="checked"
                        wrapperCol={{
                        offset: 8,
                        span: 16,
                        }}
                    >
                        <Checkbox>Remember me</Checkbox>
                    </Form.Item>

                    <Form.Item
                        wrapperCol={{
                        offset: 8,
                        span: 16,
                        }}
                    >
                        <Button type="primary" htmlType="submit">
                        Submit
                        </Button>
                    </Form.Item>
                    </Form>
           </Modal>
        </>
    )
}

export default PostBike
